class MainOrderModel {  String? status;  List<OrderModel>? orderModel;  MainOrderModel({this.status, this.orderModel});  MainOrderModel.fromJson(Map<String, dynamic> json) {    status = json['status'];    if (json['data'] != null) {      orderModel = <OrderModel>[];      json['data'].forEach((v) {        orderModel!.add(OrderModel.fromJson(v));      });    }  }}class OrderModel {  int? orderId;  int? orderUserId;  int? orderAddressId;  int? addressType;  int? orderPricedelivery;  int? orderPrice;  String? orderCoupon;  String? orderDatetime;  String? orderProductId;  String? order_products_count;  int? order_payment_method;  int? order_in_archive;  int? order_status;  int? order_delivery;  String? order_rating;  String? order_note;  OrderModel({    this.orderId,    this.orderUserId,    this.orderAddressId,    this.addressType,    this.orderPricedelivery,    this.orderPrice,    this.orderCoupon,    this.orderDatetime,    this.order_payment_method,    this.order_products_count,    this.order_in_archive,    this.order_status,    this.order_delivery,    this.order_rating,    this.order_note,  });  OrderModel.fromJson(Map<String, dynamic> json) {    orderId = json['order_id'];    orderUserId = json['order_user_id'];    orderAddressId = json['order_address_id'];    addressType = json['address_type'];    orderPricedelivery = json['order_pricedelivery'];    orderPrice = json['order_price'];    orderCoupon = json['order_coupon'];    orderDatetime = json['order_datetime'];    orderProductId = json['order_product_id'];    order_payment_method = json['payment_method'];    order_products_count = json['order_products_count'];    order_status = json['order_status'];    order_delivery = json['order_delivery'];    order_in_archive = json['order_in_archive'];    order_rating = json['order_rating'];    order_note = json['order_note'];  }}